3.	Project Background
JNCC are leading the implementation of two projects, entitled "Defining A Post-Covid-19 Resilient Recovery in the Turks And Caicos Islands: Sustainable Investment in the Future of the Island's People and Environment" and "Sustaining queen conch fisheries and livelihoods in the Turks and Caicos Islands". These projects are funded by the Caribbean Overseas Countries and Territories (OCTs) Resilience, Sustainable Energy and Marine Biodiversity Programme (RESEMBID), a programme financed by the European Union and implemented by Expertise France, the development cooperation agency of France. 

The bid submission should include the following:
	A brief summary of the bidder's experience in relation to the requirements of this contract; 
	A proposed approach for achieving the objectives of the contract and delivering the detailed tasks identified within each objective. This should be sufficiently detailed to allow assessment against the evaluation criteria (Section 14);
	A detailed project plan (including Gantt chart) with proposed work programme and an estimate of time required to achieve each objective;
	Details of Quality Control procedures to be followed (note for author if research project/contract: see EQA Policy Appendix 1 (Bias, Conflicting Evidence and Uncertainty) and EQU Policy Appendix 3 (Quality Assurance of Expert Knowledge and Opinion):
	Details of the bidder's own internal Quality Management System;
	Details of the Project Team including their roles and experience, an estimate of their time input into each task and CVs of all personnel who will be involved in the contract/project; please ensure all CVs MUST be attached as a separate PDF documentation from the proposal, so that we can meet our JNCC GDPR retention policy requirements. 
	Availability of the Project Team for a virtual start-up meeting.
	Overall quote for the contract to include:
o	Day rates for all members of the Project Team;
o	Rates for attending start-up, interim and final meetings in Peterborough or Aberdeen (costs for travel and accommodation are attached, and should be used. These rates are analogous to the civil service rates).
o	Costs and time allocation should be clearly allocated to specific tasks within this contract/project; and
o	VAT if applicable. The contractor is to specify whether VAT at the prevailing rate would be applicable to this project and if so, provide their VAT registration number.

	The following documentation (to submit in a zip folder separate from the proposal): 
o	Copies of health and safety policy statements where available or a note regarding such items as lone working, emergency procedures and accident reporting;
o	Copies of current public and employer liability insurance certificates;
o	Copies of any appropriate risk assessments; and
o	Copies of any environmental policies should you have them.

Additional information: You are invited by JNCC Support Co (JNCC) to submit a tender for the supply of works or services required under the above project. If interested, you should download and carefully read the documents contained within the zip file.

YSJU has set the following objectives for the new Allied Health Phase 2 project:

1.	To create a first-class medical course teaching facility responding to the University's ambitious growth profile, that will support and enhance the existing provision of student facilities at York St John; 
2.	Project delivery both on time and budget.;
3.	To contribute to the University's strategic objectives and values, as we seek to become the best of England's small universities.  

It is envisaged that construction for the building will begin by no later than June 2024, with the building being operational by no later than January 2025.

Please see attachments for further information.

The scope of the agreement provides the following goods and services:

a)	Desks;
b)	Storage;
c)	Supply and installation of bespoke furniture such as reception desks, conference tables and bistro booth seating;
d)	Supply and installation of Away from Desk (AWD) furniture, such as breakout seating, picnic style tables and phone booths;
e)	Supply and installation of freestanding, wall mounted and mobile smart walls;
f)	Supply and installation of bistro furniture;
g)	Supply and installation of outdoor seating and street furniture;
h)	Supply and installation of specialist workstation equipment;
i)	Supply and installation of homeworker furniture;
j)	Management of installations, move and waste management;
k)	Move management and removals;
l)	Waste management & sustainability;
m)	Social value;
n)	Non-standard installations or logistics tasks;
o)	Training and advice, including information on space planning and innovation within the furniture sector;
p)	Holdover storage;
q)	Warranties and quality;
r)	Orders

The main objectives of this contract are to:

	Deliver high-quality, UK Forest Standard (UKFS) compliant advice and guidance to Mersey Forest landowners and partners;
	Ensure that best practice is followed in all aspects of woodland management and establishment;
	Contribute to the successful delivery of Mersey Forest projects;
	Provide support to the Mersey Forest Team in its day-to-day operations.
